  function do_sort__auction_110(field, direction) {
    var f = jQuery('#form\\._auction_110');
    f.find(":input[name='sort']").val(field);
    f.find(":input[name='sort_direction']").val(direction);
    f.submit();
  }

  function page__auction_110(n) {
    var f = jQuery('#form\\._auction_110');
    var max = f.find(":input[name='last_page']").val() - 0;

    if (parseInt(Number(n)) != n || n < 1 || n > max) {
        alert("Please enter a page number between 1 and " + max + ".");
        return false;
    }

    f.find(":input[name='page']").val(n);
    f.submit();
  }

  function page_size__auction_110(n) {
    var f = jQuery('#form\\._auction_110');
    var submit_str =  "Submitting <img alt='' src='https://broward.deedauction.net/images/indicator.gif' style='margin-left:0 0 -4 8'/>";
    f.find(":input[name='rows']").val(n);
    jQuery('#row_chooser__auction_110').html(submit_str);
    f.submit();
  }

  function filter_table__auction_110(params) {
    var f = jQuery('#form\\._auction_110');

    f.find(":input[name='filter']").val( JSON.stringify( params ) );
    f.find(":input[name='page']").val(1);
    f.submit();
  }




  jQuery('#' + escape_metachars('form._auction_110')).click( function(event) {
    $(this).data('clicked', $(event.target))
  } );
  jQuery('#' + escape_metachars('form._auction_110')).submit( function(event) {
    event.stopImmediatePropagation();
    var form   = jQuery(this),
        params = new FormData( this ),
        button = form.data('clicked');

    /* Guess what button could have been clicked if one wasn't */
    if ( !button || !button.length || !form.has(button) ||
         !button.is('[name]') ) {
        button = form.find(":input[name='submitting']");
    }

    if ( ! params.get( button.attr( 'name' ) ) ) {
        params.append( button.attr( 'name' ), button.val() );
    }


    jQuery.ajax('https://broward.deedauction.net/table/filter', {
        type:        'POST',
        data:        params,
        contentType: false,
        processData: false,

        beforeSend: function(request) {
            request.url = form.attr('action');
            ajax_start(request);
        },
        complete: function(request) {json_reader(request); ajax_after(request);}
    })
    /* IE errors: 12031 == 0x2eff, 12052 == 0x2f14 */
    .retry({times:3, statusCodes: [12031, 12052]})
    .fail(function() { form.find('.click_once').trigger('unlock') });

    return false;
  });



